function readDocuments(cb) {
  const db = self.documentsDB
  if (!db) {
    console.log('sw: cant find self.documentsDB')
    return false
  }
  const objectStore = db.transaction('documents').objectStore('documents')
  const index = objectStore.index('dateAdded')
  self.documents = []
  index.openCursor(null, "prev").onsuccess = function(event) {
    const cursor = event.target.result
    let once = true
    if (cursor) {
      if (once) {
        self.latestDocument = cursor.value
        once = false
      }
      self.documents.push(cursor.value)
      cursor.continue()
    } else {
      cb()
    }
  }
}

